import React from 'react';
import s from "./Dialogs.module.css"
import NavLink from "react-router-dom/modules/NavLink";

const Dialogs = (props)=>{
    return(
        // <div className={s.content} >
            /*<h2>Dialogs</h2>*/
            <div className={s.dialogs}>
                <div className={s.dialogsItems}>
                    <div className={s.dialog +' '+s.active}> <NavLink to="/dialogs/1">Andrey</NavLink> </div>
                    <div className={s.dialog}> Alexandr</div>
                    <div className={s.dialog}> Darya</div>
                    <div className={s.dialog}> Ivan</div>
                </div>
                <div className={s.dialogsMessage}>
                    <div className={s.message}> Hello</div>
                    <div className={s.message}> How are you, man?</div>
                    <div className={s.message}> What interestind in your life? </div>
                    <div className={s.message}> I'm glad to hear you! </div>
                </div>
            </div>

        // </div>
    )
}
export default Dialogs;
